    margin-top: 120px;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
`
export const Wrapper = styled.div`
    max-width:300px;
`
export const Wrapper2 = styled.div`

`

export const Column = styled.div`
flex:1
`
export const Row = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-content: center;
    margin-top: 20px;
